def nextGreaterElements(nums: 'List[int]'):
    temp = nums + nums
    cnt = 0
    output = []
    for i in range(len(temp)):
        cnt += 1
        curr = temp[i]
        found = 0
        for j in range(i + 1, len(temp)):
            if temp[j] > curr:
                output.append(temp[j])
                found = 1
                break

        if found == 0:
            output.append(-1)

        if len(output) == len(nums):
            return output


    return output

